import React, {Component, createElement} from 'react';
import './SongStyle/SongStyle.css';
import Axios from 'axios';
import Link from 'next/link';
import { BrowserRouter as Router, Route} from "react-router-dom";

class SongList extends Component{
    constructor(props){
        super(props)
        this.state = {
          songs: [],
          comp: []
        }
    }     
    componentDidMount(){
        Axios.get('http://localhost:3210/allSongs').then ((response) => { this.setState({songs: response.data})});
    }
    render(){
        return(
            <ul>
                {this.state.songs.map((value) => {console.log(value)
                    return (

                        <SongRef
                        name = {value.name}
                        comp_id = {value.comp_id}
                        id = {value.id}
                        cname = {value.cname}
                        />
                    );
                })}
            </ul>
        );
    }



}

const SongRef = props =>(
    <Link to ={{
        pathname:'./song',
        aboutProps:{
            name: 'qwerty'
        }
    }}>
        <li><a onClick = {handleClick()}>{props.cname} - {props.name}</a></li>
    </Link>
);

export default SongList;
